Compreende/Registra as variações patrimoniais diminutivas, decorrentes do imposto, de competência da União, sobre produtos industrializados tem como fato gerador:

 i o seu desembaraço aduaneiro, quando de procedência estrangeira;

 ii a sua saída dos estabelecimentos a que se refere o parágrafo único do artigo 51 do CTN;

 iii a sua arrematação, quando apreendido ou abandonado e levado a leilão.
para os efeitos deste imposto, considera se industrializado o produto que tenha sido submetido a qualquer operação que lhe modifique a natureza ou a finalidade, ou o aperfeiçoe para o consumo.

Compreende/Registra as variações patrimoniais diminutivas com o imposto, de competência da união, sobre operações de crédito, câmbio e seguro, e sobre operações relativas a títulos e valores mobiliários que tem como fato gerador:

 i - quanto as operações de crédito, a sua efetivação pela entrega total ou parcial do montante ou do valor que constitua o objeto da obrigação, ou sua colocação a disposição do interessado;

 ii - quanto as operações de câmbio, a sua efetivação pela entrega de moeda nacional ou estrangeira, ou de documento que a represente, ou sua colocação a disposição do interessado em montante equivalente a moeda estrangeira ou nacional entregue ou posta a disposição por este;

 iii - quanto as operações de seguro, a sua efetivação pela emissão da apólice ou do documento equivalente, ou recebimento do prêmio, na forma da lei aplicável;

 iv - quanto as operações relativas a títulos e valores mobiliários, a emissão, transmissão, pagamento ou resgate destes, na forma da lei aplicável.

Compreende a estimativa do montante relativo a ações judiciais em andamento contra o ente federativo nas quais haja a probabilidade de que o ganho de causa venha a ser da outra parte. Ao fazer a estimativa, considerar os principais tipos de ação judicial, tais como:
a) Demandas judiciais contra a atividade reguladora do Estado: Indexação e controles de preços; De ordem tributária e previdenciária; Outras demandas judiciais;
b) Demandas judiciais contra empresas estatais dependentes;
c) Demandas judiciais contra a administração direta e indireta: Privatizações, liquidação ou extinção de órgãos ou empresas; Reajustes salariais;
d) Demandas trabalhistas contra o ente federativo;
e) Outras demandas judiciais. Tais registros devem ser realizados pra fins de preenchimento do Quadro das Contas de Compensação do Anexo do Balanço Patrimonial, conforme disposto na Lei n. 4.320/64, os quais serão considerados para fins da Consolidação Nacional no Balanço do Setor Público Nacional - BSPN.

