Compreende/Registra a estimativa do montante que apresenta probabilidade de vir a ser gasto pelo ente federativo com o objetivo de proteger o cidadão ou sistemas importantes do Mercado contra inadimplências, falências, altos prejuízos, ou garantir a credibilidade desses sistemas frente a fatores agudos adversos. Ao fazer a estimativa, considerar os principais tipos de situações que podem advir:
a) de órgãos da administração direta ou indireta;
b) de entidades privadas;
c) de Regime Próprio de Previdência Social dos Servidores Públicos;
d) de Entes da Federação;
e) do Regime Geral de Previdência Social;
f) do Banco Central; e
g) da assunção de outros passivos.

Compreende/Registra a estimativa do montante de redução no valor dos ingressos ou de aumento no valor dos desembolsos que apresentam probabilidade de vir a ocorrer no exercício, decorrentes de evolução desfavorável de indicadores econômicos empregados na época da elaboração do Orçamento, tais como:
a) Taxa de crescimento econômico;
b) Taxa de inflação;
c) Taxa de câmbio;
d) Taxa de juros;
e) Salário mínimo;
f) Outros indicadores.

